import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import { useState } from "react"; 
impo
import "./App.css";

function App() {
  return (
    <Router>
      <div className="app-container">
        <Navbar />
        <Routes>
          <Route path="/" element={<Login />} />
          <Route path="/signup" element={<Signup />} />
          <Route path="/dashboard" element={<Dashboard />} />
        </Routes>
      </div>
    </Router>
  );
}

function Navbar() {
  return (
    <nav className="navbar">
      <h1>News Summarizer</h1>
      <div>
        <Link to="/" className="nav-link">Login</Link>
        <Link to="/signup" className="nav-link">Sign Up</Link>
      </div>
    </nav>
  );
}

function Login() {
  return (
    <div className="auth-container">
      <h2>Login</h2>
      <input type="text" placeholder="Email" />
      <input type="password" placeholder="Password" />
      <Link to="/dashboard">
        <button>Login</button>
      </Link>
    </div>
  );
}

function Signup() {
  return (
    <div className="auth-container">
      <h2>Sign Up</h2>
      <input type="text" placeholder="Name" />
      <input type="email" placeholder="Email" />
      <input type="password" placeholder="Password" />
      <Link to="/dashboard">
        <button>Sign Up</button>
      </Link>
    </div>
  );
}

function Dashboard() {
  const [search, setSearch] = useState("");
  return (
    <div className="dashboard">
      <h2>Welcome to the News Summarizer</h2>
      <input
        type="text"
        placeholder="Search for news..."
        className="search-bar"
        value={search}
        onChange={(e) => setSearch(e.target.value)}
      />
      <NewsCategories />
      <NewsSuggestions />
    </div>
  );
}

function NewsCategories() {
  const categories = ["Technology", "Business", "Sports", "Health"];
  return (
    <div className="categories">
      {categories.map((category) => (
        <button key={category} className="category-btn">
          {category}
        </button>
      ))}
    </div>
  );
}

function NewsSuggestions() {
  const newsItems = [
    { title: "Tech Innovation 2024", img: "https://via.placeholder.com/200" },
    { title: "Stock Market Insights", img: "https://via.placeholder.com/200" },
    { title: "Olympics Highlights", img: "https://via.placeholder.com/200" },
  ];
  return (
    <div className="news-section">
      {newsItems.map((news, index) => (
        <div key={index} className="news-item">
          <img src={news.img} alt={news.title} />
          <h3>{news.title}</h3>
        </div>
      ))}
    </div>
  );
}

export default App;
